var title_f34_57_35733="Pathogenesis cluster headache";
var content_f34_57_35733=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F81378&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F81378&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 527px\">",
"   <div class=\"ttl\">",
"    Pathogenesis of cluster headache",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 507px; height: 563px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Schematic model showing most of the putative actors in CH pathogenesis. Pain afferents from the trigeminovascular system synapse on the trigeminocervical complex (TNC), and then project to the thalamus and lead to activation in cortical areas known to be involved in pain transmission. Either a direct influence of the hypothalamus or a reflex activation of the parasympathetic outflow from the superior salivatory nucleus (SSN) predominately through the pterygopalatine (sphenopalatine) ganglion, leads to the parasympathetic symptoms ipsilateral to the pain. A third-order sympathetic nerve lesion, thought to be caused by vascular changes in the cavernous sinus loggia with subsequent irritation of the local plexus of nerve fibers, results in a partial Horner's syndrome. The key site in the CNS for triggering the pain and controlling the cycling aspects is in the posterior hypothalamic grey matter region, modulated by phase-shifting in the suprachiasmatic nuclei.",
"    <div class=\"footnotes\">",
"     Abbreviations: Ggl = ganglion, HT = hypothalamus, ICA = internal carotid artery, NV = trigeminal nerve, PPT = pterygopalatine, SCG = superior cervical ganglion, SN = suprachiasmatic nucleus, SSN = superior salivatory nucleus, TNC = trigeminal nucleus caudalis",
"    </div>",
"    <div class=\"reference\">",
"     Modified from: May A. Cluster headache: pathogenesis, diagnosis, and management. Lancet 2005; 366:847.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
