"   <div class=\"block mop drugH1Div\" id=\"F147470\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Observe for signs and symptoms of anaphylaxis during first dose; CBC with differential (especially with long courses); renal function",
"    </p>",
"   </div>",
