"   <div class=\"block pha drugH1Div\" id=\"F147459\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Inhibits bacterial cell wall synthesis by binding to one or more of the penicillin-binding proteins (PBPs) which in turn inhibits the final transpeptidation step of peptidoglycan synthesis in bacterial cell walls, thus inhibiting cell wall biosynthesis. Bacteria eventually lyse due to ongoing activity of cell wall autolytic enzymes (autolysins and murein hydrolases) while cell wall assembly is arrested.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F147478\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: Widely to body tissues and fluids including aqueous humor, ascitic and prostatic fluids, bone; penetrates CSF best when meninges are inflamed",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Partially hepatic to active metabolite, desacetylcefotaxime",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Cefotaxime: Infants &le;1500 g: 4.6 hours; Infants &gt;1500 g: 3.4 hours; Adults: 1-1.5 hours; prolonged with renal and/or hepatic impairment",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Desacetylcefotaxime: 1.5-1.9 hours; prolonged with renal impairment",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
