"   </div>",
"   <div class=\"lgnd\">",
"    Low power photomicrograph of a spindle cell carcinoma (left panel). The growth pattern is one of interlacing fascicles or pinwheel (storiform) arrangements. These tumors need to be distinguished from sarcomas and melanomas, and immunostains for cytokeratin (right panel) are useful in this regard.",
