var title_f34_57_35740="General management of patients with complicated PUD";
var content_f34_57_35740=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F65479&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F65479&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    General management of patients with complicated peptic ulcer disease",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Initial management",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1. Monitor blood pressure, electrocardiogram, and oxygen saturation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. Provide supplemental oxygen, if oxygen saturation is reduced.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3. Patient should take nothing by mouth.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4. Ensure adequate intravenous access.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        5. Elective/urgent endotracheal intubation for patients with ongoing hematemesis, respiratory failure, or altered mental status.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        6. Fluid resuscitation, plus blood transfusions, as needed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        7. Give intravenous, full dose PPI.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        8. Obtain gastroenterology consultation for consideration of upper endoscopy, unless perforation is suspected.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        9. Obtain surgical consultation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Once patient is tolerating oral intake",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1. Switch to full dose oral PPI twice daily.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. Treat for",
"        <em>",
"         H. pylori",
"        </em>",
"        if tests are positive*.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3. Ensure non-aspirin NSAIDs are stopped, if at all possible. Otherwise, switch to celecoxib plus PPI and monitor closely, including periodic endoscopy.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4. Stop aspirin, including low-dose aspirin, if possible.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        5. For gastric ulcers, at 4 to 6 weeks, perform upper endoscopy to evaluate healing and exclude neoplasia (unless there is confidence that the stomach and duodenum were adequately evaluated endoscopically or surgically during hospitalization). Giant duodenal ulcers also warrant follow-up endoscopy to ensure healing and exclude rare malignancy or other etiologies.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        6. If initial tests for",
"        <em>",
"         H. pylori",
"        </em>",
"        are negative, at roughly 4 weeks (or later for large ulcers):",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        a. Switch to full dose H2 receptor antagonists and continue for two weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        b. If an upper endoscopy will be performed, biopsy for",
"        <em>",
"         H. pylori",
"        </em>",
"        urease testing and histology",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        c. If upper endoscopy will not be performed, obtain an",
"        <em>",
"         H. pylori",
"        </em>",
"        breath test or stool antigen test",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     PPI: proton pump inhibitor;",
"     <em>",
"      H. pylori",
"     </em>",
"     :",
"     <em>",
"      Helicobacter pylori",
"     </em>",
"     ; NSAID: nonsteroidal antiinflammatory drug.",
"     <br>",
"      * With an established ulcer,",
"      <em>",
"       H. pylori",
"      </em>",
"      is only ruled out when two tests obtained while the patient is off of antibiotics, PPIs, and bismuth are negative.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f34_57_35740=[""].join("\n");
var outline_f34_57_35740=null;
var title_f34_57_35741="Opioid intoxication in children and adolescents - Rapid overview";
var content_f34_57_35741=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F69375&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F69375&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Opioid intoxication in children and adolescents: Rapid overview",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        <span style=\"color: #ff0000;\">",
"         To obtain emergent consultation with a medical toxicologist, call the United States Poison Control Network at 1-800-222-1222, or access the World Health Organization's list of international poison centers (",
"        </span>",
"        <a href=\"file://www.who.int/gho/phe/chemical_safety/poisons_centres/en/index.html\" target=\"_blank\">",
"         www.who.int/gho/phe/chemical_safety/poisons_centres/en/index.html",
"        </a>",
"        <span style=\"color: #ff0000;\">",
"         ).",
"        </span>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Clinical features*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Depressed mental status ranging from lethargy to coma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Miotic pupils (often pinpoint)",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Depressed respirations including apnea",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bradycardia and hypotension",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Decreased to absent bowel sounds",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Track marks (adolescents with IV drug abuse)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Ancillary studies",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Blood glucose and pulse oximetry in patients with coma and depressed respirations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Serum ethanol level, especially in adolescents with recreational or suicidal overdose",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Serum acetaminophen if suicidal intent or ingestion of combination medications (eg, acetaminophen with oxycodone)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Electrocardiogram in patients intoxicated with methadone (prolonged QTc) or propoxyphene (prolonged QRS)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chest radiograph in patients with persistent respiratory findings that suggest pulmonary aspiration or noncardiogenic pulmonary edema",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Urinalysis, serum electrolytes, blood urea nitrogen, creatinine, and creatine kinase in patients with prolonged immobilization or muscular rigidity at risk for rhabdomyolysis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rapid urine pregnancy test in postmenarchal girls",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rapid urine testing for opioids in young children and infants with coma from unknown cause or in whom intentional poisoning by a caretaker is suspected",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Support airway and breathing using bag-mask ventilation with 100 percent inspired oxygen until naloxone is administered",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Give naloxone for deep coma and respiratory depression as follows",
"        <sup>",
"         &sect;",
"        </sup>",
"        :",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        - Children &lt;20 kg: 0.1 mg/kg IV or IO (maximum 2 mg per dose)",
"        <strong>",
"         except neonates",
"        </strong>",
"        <sup>",
"         &yen;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        - Children over 20 kg: 2 mg IV or IO",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        - Adolescents suspected of opioid addiction: 0.04 to 0.4 mg per dose repeated every 3-5 minutes and titrated to patient response",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        - If no effect, repeat the naloxone dose every one to two minutes to a maximum total dose of 10 mg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         - Patients with recurrent toxicity may receive additional bolus doses or a continuous naloxone infusion. Begin the infusion rate at 2/3 of the total dose of naloxone needed to restore breathing, delivered every hour.",
"        </p>",
"        <ul>",
"         <li>",
"          If the patient develops respiratory depression despite the naloxone infusion (this may happen 20 to 30 minutes after starting infusion) administer a naloxone bolus (using half the original effetive bolus dose) and repeat if necessary until adequate ventilation returns, then increase the infusion rate",
"         </li>",
"         <li>",
"          If the patient develops signs of opioid withdrawal, stop the infusion. If respiratory depression returns, start the infusion at half the original rate.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Give activated charcoal (1 gram/kg orally or by nasogastric tube, maximum dose 50 grams) to alert young children and adolescents who present within one hour of oral overdose",
"        <sup>",
"         ",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        In cases of suspected child abuse, consult an experienced children protection team (if available) and report suspicion to the appropriate governmental agency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Consult psychiatry for patients with substance abuse or suicidal intent",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     IO: intraosseous; AC: activated charcoal; ET: endotracheal tube; IM: intramuscular.",
"     <br>",
"      * The diagnosis of opioid intoxication is based upon clinical features and response to antidotal therapy.",
"      <br>",
"       &Delta; Small pupils are not always present in children and adolescents with opioid intoxication.",
"       <br>",
"        <font class=\"lozenge\">",
"         &loz;",
"        </font>",
"        Other ancillary studies may be indicated in selected patients in whom trauma, infection, or other etiologies besides poisoning are suspected. (See \"Evaluation of stupor and coma in children\" and \"Approach to the child with occult toxic exposure\").",
"        <br>",
"         &sect; Naloxone may also be given intramuscularly or intratracheally via endotracheal tube (ET) in children or adolescents with poor IV access. If an endotracheal tube is present, ET administration is preferred over intramuscular, if IV and IO routes not available. ET dose is approximately two to three times IV dose.",
"         <br>",
"          &yen; Naloxone administration is not recommended as part of initial resuscitation of neonates in the delivery room. Refer to UpToDate topics on neonatal resuscitation.",
"          <br>",
"           &Dagger; AC should be withheld in patients who are sedated and may not be able to protect their airway, unless endotracheal intubation is performed first or naloxone therapy is effective in maintaining an alert state. Endotracheal intubation should not be performed solely for the purpose of giving AC.",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
